import {START_APP, UPLOADING, UPLOADED, SEEK_URI, SEEK_RESULT, GET_RESULT } from './actionTypes';

export const startApp = () => ({
    type: START_APP
});

export const uploading = () => ({
    type: UPLOADING
});

export const uploaded = () => ({
    type: UPLOADED
});

export const seekUri = () => ({
    type: SEEK_URI
});

export const seekResult = () => ({
    type: SEEK_RESULT
});

export const getResult = () => ({
    type: GET_RESULT
});
